Samochód w pełni sprawny, serwisowany w porządnym warsztacie, specjalizującym się w autach Skody. 
Pełna książka serwisowa.
Rozrząd wymieniony przy 202.000. Silnik znany z trwałości i dobrej pracy z LPG.
A że samochód ma swoje lata, to:
- pojawia się rdza, zderzak przedni pęknięty, maska lekko wgnieciona,
rysy parkingowe na drzwiach . . . co widać na zdjęciach.
Oleju praktycznie nie bierze, za to co pewien czas trzeba dolać płynu chłodzącego.
Proszę o kontakt po godz. 18-ej.
